text:
Lembretes:
+Parlamentarismo sem plebiscito é GOLPE; 

+Impeachment sem crime de responsabilidade é GOLPE;

+GOLPE militar de 1964 é GOLPE.

“André Singer: Parlamentarismo vai ressurgir como carta na manga” https://t.co/fFlHDFp0Uc

Eu não torço contra o Brasil, eu torço contra:

- Fábrica de fake news;
- Milícia;
- Desvio de dinheiro com funcionários de gabinete;
- Laranjas;
- Retrocesso da Educação;
- Destruição da política externa;
- Conspiracionismo e alarmismo.

É isso q eu torço contra.

